import "./cliente.css"
function Cliente(props) {
    return     <div>
        
    <img className="estrela" src="https://uxwing.com/wp-content/themes/uxwing/download/arts-graphic-shapes/star-icon.png"/>
    <b>{props.nome}</b> <br/>
    {props.cidade} - {props.uf}
    <hr/>
  </div>
}

export default Cliente
